package main

import "fmt"

func findTheDifference(s string, t string) byte {
	var sumT rune
	for _, char := range t {
		sumT += char
	}

	for _, keyword := range s {
		sumT -= keyword
	}
	// fmt.Printf("result %v \n", string(sumT))
	return byte(sumT)
}

func main() {
	// s := "abcd"
	// t := "abcde"

	// s := ""
	// t := "y"

	// s := "a"
	// t := "aa"

	s := ""
	t := ""
	result := findTheDifference(s, t)
	fmt.Printf("result %v \n", result)
}
